INSERT INTO `kpis` VALUES (48,'2018-04-26 20:29:05','2020-04-30 18:37:18',1,1,'Budgeted Cost of Work Performed.  Total PV * % of Completion.','$PCW  * $PB','BAR','Earned Value','EV or BCWP','NUMERIC',1,1),(49,'2018-04-26 20:30:56','2019-11-29 17:13:21',1,1,'Actual Cost of Work Performed','$AV','BAR','Actual Cost','AC or ACWP','NUMERIC',1,1),(50,'2018-04-26 21:23:12','2018-04-26 21:23:12',1,1,'ROI= (Ganancia del Proyecto - Costo del Proyecto) entre el Costo  del Proyecto','($PF-$AV)/$AV','DONUT','Return Of Investment','ROI','PERCENT',1,1),(51,'2020-06-06 01:21:27',NULL,1,1,'% of Work Completed per dollar spent . EV / AC. If > 1 ahead of schedule and/or under budget. <1 behind schedule and/or over budget.-','$','BAR','Cost Perfomance Index','CPI','NUMERIC',1,1),(52,'2020-06-06 01:21:27',NULL,1,1,'Work Performed against Work Scheduled. EV / PV. If > 1 ahead of schedule and/or under budget. <1 behind schedule and/or over budget.-','$','BAR','Schedule Perfomance Index','SPI','NUMERIC',1,1),(53,'2020-06-06 01:21:27',NULL,1,1,'Case 1 (you suppose your future perfomance will be the same than the actual one: PV/CPI. In the beginning of the project PV = EAC. Case 2 (you are over budget but wont happen again and you will continue with the planned cost estimated).  EAC = AC + (BAC  EV).   Case 3 (your are over budget, behind schedule but customer still requires to complete the project on time). EAC = AC + (BAC  EV)/(CPI*SPI).  Case 4 (This is the case when you find out that your cost estimate was flawed and you need to calculate the new cost estimate for the remaining projects work.). EAC = AC + Bottom-up Estimate to Complete. The results from all of them are USD.-','$','BAR','Estimate at Completion','EAC','NUMERIC',1,1),(54,'2020-06-06 01:21:27',NULL,1,1,'PV-EAC. If the value < 1 may be over budget when it is complete. If the value > 1 your project may go under budget when it is complete. ','$','BAR','Variance at Completion (VAC)','VAC','NUMERIC',1,1),(55,'2020-06-06 01:21:27',NULL,1,1,'EV-PV. If < 1 behind schedule and/or over budget. If > 1 ahead of shedule and/or under budget.','$','BAR','Schedule Variance','SV','NUMERIC',1,1),(56,'2020-06-06 01:21:27',NULL,1,1,'EV-AC','$','BAR','Cost Variance','CV','NUMERIC',1,1),(57,'2020-06-06 01:21:27',NULL,1,1,'Minimum Funds Needed if things do not get worse = PV/CPI','PV/CPI','BAR','Minimum Funds Needed','MFN ','NUMERIC',1,1),(58,'2020-06-06 01:21:27',NULL,1,1,'PV / (CPI * SPI) .- Funds Need to finish the project with the actual level of slippage ','PV / (CPI * SPI)','BAR','Funds Need with the same level of slippage','FNSL','NUMERIC',1,1),(59,'2020-06-06 01:34:31',NULL,1,1,'RRR= ( 1+Nominal Rate / 1+Inflation Rate ) -1. Can be used to determine the effective return on an investment after adjusting for inflation.','( 1+Nominal Rate / 1+Inflation Rate ) -1','$','Real Rate Of Return','RRR','NUMERIC',1,1),(60,'2020-06-06 02:09:09',NULL,1,2,'% of missed milestones up to date. If this number is high may be is time to re-estime the efforts and process.','Milestones',NULL,'Milestones','Milestones',NULL,1,1),(61,'2020-06-06 02:09:09',NULL,1,2,'Number of task that should have been started but  has been reescheduled (%). If it is high there may be some problem with the team capacity or others related issues to check.-','Activities',NULL,'Activities','Activities',NULL,0,1),(62,'2020-06-06 02:09:09',NULL,1,2,'Number of commitments in the current sprint','Commitments',NULL,'Commitments','Commitments',NULL,0,1),(63,'2020-06-06 02:09:09',NULL,1,2,'Tasks started but not finished on time','Overdue Tasks',NULL,'Overdue Tasks','Overdue Tasks',NULL,1,1),(64,'2020-06-06 02:14:29',NULL,1,2,'Number of scope changes that were approved','Scope',NULL,'Scope Changes','Scope',NULL,1,1),(65,'2020-06-06 02:14:29',NULL,1,2,'% of Task Completed','Task Completed',NULL,'Task Completed','Task Completed',NULL,1,1),(66,'2020-06-06 02:14:29',NULL,1,2,'Planned Hours Vs  Actual Hours','Planned Hours',NULL,'Planned Hours','Planned Hours